body {
  margin:0;
  padding:0;
  width:100%;
  overflow: hidden;
  height:100%;
  box-sizing: border-box;
}
.site-header {
  height: 3rem;
  position: relative;
  z-index: 2;
  background-color: #fff;
  box-shadow: 0 4px 0 0 rgba(170, 98, 4, 0.26);
  padding: 0 1rem;
}

.site-title {
  font-size: 1.25rem;
  line-height: 4rem;
}

.site-main {
  position: relative;
  z-index: 1;
}
@media screen and (min-width: 64em) {
  .site-main {
    height: calc(100vh - 4rem);
  }
}

.search-container {
  position: relative;
  z-index: 3;
  box-shadow: 0 4px 0 rgba(170, 98, 4, 0.26);
  padding: 0.5rem 0.25rem 0.25rem;
}
@media print, screen and (min-width: 40em) {
  .search-container {
    position: absolute;
    top: 0;
    right: 0;
    width: 15rem;
    height: 3.25rem;
    overflow: visible;
    background-color: WhiteSmoke;
    box-shadow: 0 2px 0 rgba(170, 98, 4, 0.26), -4px 0 0 rgba(170, 98, 4, 0.26);
  }
}
@media screen and (min-width: 64em) {
  .search-container {
    right: auto;
    left: 0;
    box-shadow: 0 2px 0 rgba(170, 98, 4, 0.26), 4px 0 0 rgba(170, 98, 4, 0.26);
  }
}

.search {
  margin: 0;
  border-radius: .5rem !important;
  font-size: 1.5rem !important;
}

.search-results {
  display: none;
  margin: 0;
}
@media print, screen and (min-width: 40em) {
  .search-results {
    position: absolute;
    top: 100%;
    right: 0;
    min-width: 100%;
    box-shadow: 0 4px 0 rgba(170, 98, 4, 0.26);
  }
}
.search-results li {
  border-top: 1px solid #ddd;
  padding: 0.25rem;
}

.search:focus + .search-results, .search-results:has(li:active) {
  display: block;
  background-color: White;
}

.map-container {
  height: calc(100vh - 77px);
}
@media screen and (min-width: 64em) {
  .map-container {
    height: 100vh;
  }
}

#map {
  width: 100%;
  height: 100%;
}

.sidebar {
  z-index: 2;
  padding: 1rem;
  background-color: WhiteSmoke;
}
@media print, screen and (min-width: 40em) {
  .sidebar {
    margin-top: 3.25rem;
    height: calc(60vh - 3.25rem);
    overflow-y: auto;
    box-shadow: -4px 0 0 0 rgba(170, 98, 4, 0.26);
  }
}
@media screen and (min-width: 64em) {
  .sidebar {
    height: calc(100% - 3.25rem);
    box-shadow: 4px 0 0 0 rgba(170, 98, 4, 0.26);
  }
}

.content-close-button-container {
  position: relative;
  z-index: 4;
  width: 100%;
  box-shadow: 0 -2px 0 rgba(170, 98, 4, 0.26);
  background-color: White;
  text-align: right;
  padding: 1rem 1rem 0;
  margin-bottom: -1rem;
}
@media screen and (min-width: 64em) {
  .content-close-button-container {
    padding: 0;
    margin-bottom: 0;
  }
}

.content-close-button {
  color: #6b717b;
  font-size: 2rem;
  line-height: 1;
  position: relative;
  margin: 0;
  width: 1em;
}

.google-maps-button {
  display: block;
  margin: 0 auto;
  padding: 0.5rem 1rem;
  background-color: #3180e1;
  color: #fff;
  font-weight: 700;
  border-radius: 0.25rem;
  text-align: center;
  text-decoration: none;
}
@media screen and (min-width: 64em) {
  .content-close-button {
    display: block;
    position: fixed;
    z-index: 3;
    top: 5.5rem;
    right: 24.66667%;
    background-color: White;
    margin-right: -4px;
    padding: 0 0.375rem 0.1875rem;
    box-shadow: -4px 4px 0 rgba(170, 98, 4, 0.26);
  }
}

.content {
  padding: 1rem;
  z-index: 3;
  position: absolute;
  bottom: 0;
  z-index: 4;
  width: 100%;
  box-shadow: 0 -2px 0 rgba(170, 98, 4, 0.26);
  background-color: White;
  padding: 1rem;
}
@media screen and (min-width: 64em) {
  .content {
    box-shadow: -4px 0 0 0 rgba(170, 98, 4, 0.26);
    height: calc(100%);
    overflow-y: auto;
    height: 170px;
    top: 60px;
    right: 20px;
  }
}

@media print, screen and (min-width: 40em) {
  .site-main:not(.has-content-open) .map-container,
  .site-main:not(.has-content-open) .sidebar {
    height: calc(100vh);
  }
}

.ol-popup {
  position: absolute;
  background-color: white;
  -webkit-filter: drop-shadow(0 1px 4px rgba(0,0,0,0.2));
  filter: drop-shadow(0 1px 4px rgba(0,0,0,0.2));
  padding: 4px;
  border-radius: 10px;
  border: 1px solid #cccccc;
  bottom: 12px;
  left: -50px;
  min-width: 280px;
}
.ol-popup:after, .ol-popup:before {
  top: 100%;
  border: solid transparent;
  content: " ";
  height: 0;
  width: 0;
  position: absolute;
  pointer-events: none;
}
.ol-popup:after {
  border-top-color: white;
  border-width: 10px;
  left: 48px;
  margin-left: -10px;
}
.ol-popup:before {
  border-top-color: #cccccc;
  border-width: 11px;
  left: 48px;
  margin-left: -11px;
}
.ol-popup-closer {
  text-decoration: none;
  position: absolute;
  top: 2px;
  right: 8px;
}
.ol-popup-closer:after {
  content: "âœ–";
}
h3{
  text-align: center;
  margin-top: 0 !important;
}
p {
  text-align: center;
}
.download:hover {
  /* Start the shake animation and make the animation last for 0.5 seconds */
  animation: shake 0.5s; 

  /* When the animation is finished, start again */
  animation-iteration-count: infinite; 
}

@keyframes shake {
  0% { transform: translate(1px, 1px) rotate(0deg); }
  10% { transform: translate(-1px, -2px) rotate(-1deg); }
  20% { transform: translate(-3px, 0px) rotate(1deg); }
  30% { transform: translate(3px, 2px) rotate(0deg); }
  40% { transform: translate(1px, -1px) rotate(1deg); }
  50% { transform: translate(-1px, 2px) rotate(-1deg); }
  60% { transform: translate(-3px, 1px) rotate(0deg); }
  70% { transform: translate(3px, 1px) rotate(-1deg); }
  80% { transform: translate(-1px, -1px) rotate(1deg); }
  90% { transform: translate(1px, 2px) rotate(0deg); }
  100% { transform: translate(1px, -2px) rotate(-1deg); }
}

/* popup loader */
.loader {
  border: 5px solid #f3f3f3;
  border-radius: 50%;
  border-top: 5px solid rgb(255, 174, 0);
  border-bottom: 5px solid rgb(255, 174, 0);
  width: 50px;
  height: 50px;
  -webkit-animation: spin 2s linear infinite;
  animation: spin 2s linear infinite;
}

@-webkit-keyframes spin {
  0% { -webkit-transform: rotate(0deg); }
  100% { -webkit-transform: rotate(360deg); }
}

@keyframes spin {
  0% { transform: rotate(0deg); }
  100% { transform: rotate(360deg); }
}

.panel {
  border: none !important;
  padding: 2px !important;
  box-shadow: none !important;
  -webkit-box-shadow: none !important;
  -moz-box-shadow: none !important;
}
